// To print number based on input

import java.util.*;
public class progA {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("To print number based on input");
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		for(int i=1;i<=n;i++) {
			System.out.print(i+" ");
		}
	}

}
